import React, { Component } from 'react'
import {bindActionCreators} from 'redux'
import {connect} from 'react-redux'
import * as categoryActions from '../redux/actions/categoriesAction'

class AboutUnsplashComponent extends Component {
    render() {
        return (
            <div>
               <p>AboutUnsplashComponent</p>
            </div>
        )
    }
}

function mapDispatchToProps(dispatch){
    return{
        actions:{getImage:bindActionCreators(categoryActions.getImages, dispatch)}
    }

}
export default  connect(mapDispatchToProps)(AboutUnsplashComponent)
